import React from "react";
import ProjectSummary from "./ProjectSummary";

const ProjectList = () => {
  return (
    <div className="project-list section">
      {this.props.data &&
        this.props.data.map(i => {
          return (
            <div key={i.id}>
              <ProjectSummary data={i} />
            </div>
          );
        })}
    </div>
  );
};

export default ProjectList;
